window.bookSummaryJSON = "<p><b>\"Find me in another life. Find me in them all.\"</b></p> <p>Every end is also a beginning.</p> <p>I thought I was going to die, and would have if it weren't for Slade. The only way he could save me was to open a rip between worlds. The only way for me to save myself was to go through it.</p> <p>Sometimes, fleeing one dangerous place just brings you to another.</p> <p>Annwyn. The realm of the fae. There is magic and beauty here, though, around every corner, threats lurk.</p> <p>But I'm a threat too. I'm not a girl in a gilded cage anymore, and no one is going to stop me from finding my way back to Slade.</p> <p>But returning home means facing danger and secrets. So I have to burn bright enough to light my own wayâ€¦Or else I might be swallowed by the dark.</p> <p><i>The BookTok hit adult fantasy series continues in book five of this epic story inspired by the myth of King Midas, fae, and fated romance. Intended for mature listeners.</i></p> <p><i>Newly recorded in duet-style narration by Lilly Drake and Anthony Palmini.</i></p>"; 
